class App extends React.Component{
  constructor() {
    super()
    this.state = {text: 'hello'}
  }

  handleChange() {
		//тут какой-то код
	} 

  render() {    
    let li = this.state.show.map((item, index) => {
      return <li key={index}>{item}
        <button onClick={this.delItem.bind(this, index)}>delItem</button>
      </li>
    })

    return <div>
      <input value={this.state.value} onChange={this.handleChange.bind(this)} />
    </div>;
  }
}

export default App;
